	public void correctnessTest(IWidthOfBinaryTree662 solution)
	{
		assertEquals (2, solution.widthOfBinaryTree(BinaryTreeTestUtil.constructBinaryTree(new int [] {1,3,-1,5,6})));
		assertEquals (4, solution.widthOfBinaryTree(BinaryTreeTestUtil.constructBinaryTree(new int [] {1,3,2,5,3,-1,9})));
		assertEquals (7, solution.widthOfBinaryTree(BinaryTreeTestUtil.constructBinaryTree(new int [] {1,3,2,5,-1,-1,9,6,-1,7})));
		assertEquals (2, solution.widthOfBinaryTree(BinaryTreeTestUtil.constructBinaryTree(new int [] {1,3,2,5})));
	}

	public void loadWrapper (IWidthOfBinaryTree662 solution, TreeNode [] roots)
	{
		for (TreeNode root : roots)
		{
			solution.widthOfBinaryTree(root);
		}
	}

	@Test
	public int [] gen()
	{
		int [] tree = new int [2000];
		tree[1] = -1;

		for (int i=2;i<4000;i+=2)
		{
			tree[i+1]=-1;
		}
		BinaryTreeTestUtil.constructBinaryTree(tree);
		System.out.println(Arrays.toString(tree));
		return tree;
	}
